import React, { Component } from 'react'
import { Card, Button, Table, Modal, Space, Form, Input, Col, Row, Radio, message, Popconfirm } from 'antd'
import {
    PlusOutlined
} from '@ant-design/icons';
import LinkButton from '../LinkButton';

export default class Trains extends Component {
    render() {

        const columns = [
            {
                title: '编号',
                dataIndex: 'carriageNumber',
                key: '1',
                align: 'center',
            },
            {
                title: '级别',
                dataIndex: 'level',
                key: '2',
                align: 'center',
            },
            {
                title: '规格',
                dataIndex: 'size',
                key: '3',
                align: 'center',
            },
            {
                title: '座位数',
                key: '4',
                dataIndex: 'seatNumber',
                align: 'center',
            },
            {
                title: '价格基数',
                key: '5',
                dataIndex: 'priceBase',
                align: 'center',
            },
            {
                title: '适配车型',
                key: '6',
                dataIndex: 'adapter',
                align: 'center',
            },
            {
                title: '操作',
                key: '7',
                render: () => (
                    <Space size="middle">
                        <LinkButton onClick={this.showUpdateModal}>编辑</LinkButton>
                        <Popconfirm title="确定删除吗？" okText="是" cancelText="否">
                            <LinkButton onClick={this.deleteCarriage}>删除</LinkButton>
                        </Popconfirm>
                    </Space>
                ),
                align: 'center'
            },
        ];

        const data = [
            {
                key: '1',
                carriageNumber: '001',
                level: '豪华',
                size: '(4+4)*10',
                seatNumber: '20',
                priceBase: '8',
                adapter: '动车',
            },
        ]

        return (
            <div>
                <div>
                    <Card
                        title={<span style={{ fontSize: '30px' }}>车次管理</span>}
                        extra={<Button icon={<PlusOutlined />} type="primary" onClick={this.showAddModal} >新增</Button>}
                    >
                        <Table
                            columns={columns}
                            dataSource={data}
                            bordered
                            rowKey="key"
                        />
                    </Card>
                </div>
            </div>
        )
    }
}
